import React, {useState} from "react";
import {TodoData} from "./TodoData"

function Sidebar(){
  return (
    <div>
      <h1>TODO List</h1>
      <div><ul>
        {TodoData.map((val, key) =>{
         return <li key={key}>{val.heading}</li>;
        })};
        </ul>
      </div>
    </div>
  ); 
}

export default Sidebar;
